function App() {

  const expenses = [
    {title: "BEER",  amount: 2000, date: new Date(2021, 5, 28)} ,
    {title: "MILK",  amount: 1999, date: new Date(2021, 5, 28)} ,
    {title: "SODA",  amount: 2000, date: new Date(2021, 5, 28)} ,
    {title: "JUICE",  amount: 2000, date: new Date(2021, 5, 28)} ,
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also visible</p>
      <ExpressItem />
      <ExpressItem  />
      <ExpressItem />
      <ExpressItem />
    </div>
  );
}

export default App;
